        ░▄█▄▄▀ [head=3]Subject:  Setup[/head]

        ██▀░░░ [head=3]From:  Central Command[/head]

        [/color]───────────────────────────────────────

        Welcome to the IMP-KDN-Banana Station! If you arent familiar, here's a checklist of things that you'll need to enable to keep the station functioning smoothly.


        - All of the pumps and filters in the engineering department. you can see them embedded in the floor, and can click on them to turn them on.


        - The pump and filter in the medical bay are needed for the cryopod to function.


        - The radiation collectors in Frank (the crab)'s chamber. You can turn them on just by clicking on them.


        - The emitter and containment field in the shuttle bay will need to be enabled, in the same manner.


        - The solar panels on the north side of the station near arrivals will need to be calibrated. Please exercise caution, as the shuttle will not slow down if you get in its path.


        Best of luck!

        ───────────────────────────────────────

        Sincerely, CENTCOMM Engineering.
